import '../App.css';

import React from 'react';

class Auth extends React.Component {
  

    render(){
        return (
            <div>
                <form>
                    <h3>Login</h3>
                    <label >username</label>
                    <input type="text"/>
                    <label >password</label>
                    <input type="text"/>
                </form>
                <form>
                    <h3>Register</h3>
                    <label >username</label>
                    <input type="text"/>
                    <label >password</label>
                    <input type="text"/>
                </form>
            </div>);
    }
}
export default Auth;
